const express = require("express");
const upload = require("express-fileupload");
const AWS = require("aws-sdk");
const cors = require('cors');
require("dotenv").config();

const app = express();
const PORT = process.env.PORT || 3000;

app.use(upload());
app.use(express.json());
app.use(cors());

// s3 config
const s3 = new AWS.S3({
  accessKeyId: process.env.AWS_ACCESS_KEY_ID,
  secretAccessKey: process.env.AWS_SECRET_ACCESS_KEY,
});

const samplePayload = {
    "fileName": "sample-xyz.png",
    "fileData": "data:image/jpeg;base64,"
};

async function uploadFile(payload) {
  const { fileName, fileData } = payload;
  const base64Data = new Buffer.from(fileData.replace(/^data:image\/\w+;base64,/, ""), 'base64');
  const type = fileData.split(';')[0].split('/')[1];

  
  const params = {
    Bucket: process.env.AWS_BUCKET,
    Key: `creatives/${fileName}`,
    Body: base64Data,
    ACL: "public-read",
    ContentEncoding: 'base64',
    ContentType: `image/${type}`,
  };
  const data = await s3.upload(params).promise();
  return data.Location;
}

app.post("/upload", async (req, res) => {
  const fileLocation = await uploadFile(req.body);

  return res.status(200).json({ url: fileLocation });
});

app.listen(PORT, () => console.log(`server started at PORT: ${PORT}`));